/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `_id` int NOT NULL AUTO_INCREMENT,
  `goodId` int NOT NULL,
  `userId` int NOT NULL,
  `goodCount` int NOT NULL,
  `isSend` varchar(32) NOT NULL DEFAULT 'N',
  PRIMARY KEY (`_id`),
  KEY `fk_goodId` (`goodId`),
  KEY `fk_userId` (`userId`),
  CONSTRAINT `fk_goodId` FOREIGN KEY (`goodId`) REFERENCES `goods` (`_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_userId` FOREIGN KEY (`userId`) REFERENCES `user` (`_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `orders` */

insert  into `orders`(`_id`,`goodId`,`userId`,`goodCount`,`isSend`) values (2,1,1,3,'Y');

/*Table structure for table `role` */

DROP TABLE IF EXISTS `role`;

CREATE TABLE `role` (
  `_roleId` int NOT NULL AUTO_INCREMENT,
  `roleName` varchar(32) NOT NULL,
  PRIMARY KEY (`_roleId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `role` */

insert  into `role`(`_roleId`,`roleName`) values (1,'manager'),(2,'consumer');

/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `_id` int NOT NULL AUTO_INCREMENT,
  `phoneNum` varchar(32) DEFAULT NULL,
  `email` varchar(32) DEFAULT NULL,
  `pwd` varchar(32) NOT NULL DEFAULT '123456',
  `role` int NOT NULL DEFAULT '2',
  `name` varchar(32) NOT NULL DEFAULT 'user',
  `gender` varchar(32) NOT NULL DEFAULT '男',
  `address` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`_id`),
  UNIQUE KEY `phoneNum` (`phoneNum`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

